Charlotte Dujardin won two bronze medals in the individual and team open dressage events at #Tokyo2020, becoming the first British female Olympian to win six Olympic medals.

She pulled off the historic feat riding a young horse named Gio. But, let’s take a look back at the horse that started her Olympic career, the one and only Valegro.

